import UIKit

class MySellExpiredDetailRouter: MySellExpiredDetailWireframeProtocol {

    weak var viewController: UIViewController?

    static func createModule(recordId: String?) -> MySellExpiredDetailViewController {
        // Change to get view from storyboard if not using progammatic UI
        let view = MySellExpiredDetailViewController(nibName: nil, bundle: nil)
        let interactor = MySellExpiredDetailInteractor()
        let router = MySellExpiredDetailRouter()
        let presenter = MySellExpiredDetailPresenter(interface: view , interactor: interactor, router: router)

        view.presenter = presenter
        view.recordId = recordId
        interactor.presenter = presenter
        router.viewController = view

        return view
    }
}
